import React from "react";
// import "./AboutSection.scss";

const About = () => {
  const features = [
    {
      icon: "https://sangeetamedicalcentre.com/wp-content/uploads/2024/11/Asset-5-1.webp",
      title: "Consultation Services",
    },
    {
      icon: "https://sangeetamedicalcentre.com/wp-content/uploads/2024/11/Asset-3-1.webp",
      title: "Birthing Solutions",
    },
    {
      icon: "https://sangeetamedicalcentre.com/wp-content/uploads/2024/11/Asset-2-1.webp",
      title: "Identity Development",
    },
    {
      icon: "https://sangeetamedicalcentre.com/wp-content/uploads/2024/11/Asset-4-1.webp",
      title: "Treatment Strategies",
    },
  ];

  return (
    <>
      <div class="about-us bg-radius-section">
        <div class="container">
          <div class="row align-items-center">
            <div class="col-lg-6">
              <div class="about-content">
                <div class="section-title">
                  <h1
                    style={{
                      fontSize: "16px",
                      color: "#f7941d",
                      marginBottom: "10px",
                    }}
                  >
                    Trusted OB-GYN Care in Meerut
                  </h1>
                  <h2 class="text-anime-style-3" data-cursor="-opaque">
                    About Sangeeta Medical Centre
                  </h2>
                  <p class="wow fadeInUp" data-wow-delay="0.25s">
                    With over 35 years of excellence, Sangeeta Medical Centre,
                    led by Dr. Manisha Chaudhary, has been a beacon of women's
                    health in Meerut. Known for compassionate and personalized
                    care, we provide complete OB-GYN solutions—from
                    consultations and birthing support to advanced treatments
                    and surgical procedures.
                    <br />
                    <br />
                    Our mission is to ensure every woman receives expert,
                    empathetic, and effective care, backed by modern medical
                    technologies and heartfelt dedication.
                  </p>
                </div>

                <div class="about-content-body">
                  <div class="row align-items-center">
                    <div class="col-md-6">
                      <div class="about-content-list">
                        {features.map((item, index) => (
                          <>
                            <div
                              class="about-list-item wow fadeInUp"
                              data-wow-delay="0.5s"
                            >
                              <div class="icon-box">
                                <img
                                  src="images/svg-icons/icon-about-list-1.svg"
                                  alt="Advanced Orthopaedics"
                                />
                              </div>
                              <div class="about-list-content">
                                <p>Consultation Services</p>
                              </div>
                            </div>

                            <div
                              class="about-list-item wow fadeInUp"
                              data-wow-delay="0.75s"
                            >
                              <div class="icon-box">
                                <img
                                  src="images/svg-icons/icon-about-list-2.svg"
                                  alt="Advanced techniques"
                                />
                              </div>
                              <div class="about-list-content">
                                <p>Birthing Solutions</p>
                              </div>
                            </div>

                            <div
                              class="about-list-item wow fadeInUp"
                              data-wow-delay="1s"
                            >
                              <div class="icon-box">
                                <img
                                  src="images/svg-icons/icon-about-list-3.svg"
                                  alt="Personalized care"
                                />
                              </div>
                              <div class="about-list-content">
                                <p>Identity Development</p>
                              </div>
                            </div>

                            <div
                              class="about-list-item wow fadeInUp"
                              data-wow-delay="1s"
                            >
                              <div class="icon-box">
                                <img
                                  src="images/svg-icons/icon-about-list-3.svg"
                                  alt="Personalized care"
                                />
                              </div>
                              <div class="about-list-content">
                                <p>Treatment Strategies</p>
                              </div>
